import React, { useState } from "react";
import { Sidebar, Segment, Menu, Icon, Button } from "semantic-ui-react";
import { useHistory } from "react-router-dom";
import Landing from "./Landing";

export const Home = () => {
  const [visible, setVisibility] = useState(false);
  const testFolder = "";
  const stageFolder = "";
  let history = useHistory();

  const handleClick = (url: string) => history.push(url);

  const handleOpen = (env: string) => {};

  return (
    <React.Fragment>
      <Sidebar.Pushable as={Segment}>
        <Sidebar
          as={Menu}
          animation="overlay"
          icon="labeled"
          inverted
          onHide={() => setVisibility(false)}
          vertical
          visible={visible}
          width="thin"
        >
          <Menu.Item as="a">
            <Icon name="home" onClick={() => handleClick("/")} />
            Home
          </Menu.Item>
          <Menu.Item as="a" onClick={() => handleClick("/test-user")}>
            <Icon name="folder" />
            Test - Saved
          </Menu.Item>
          <Menu.Item as="a">
            <Icon
              name="folder outline"
              onMouseEnter={(data: any) => console.log("data")}
              onMouseLeave={() => console.log("leave")}
            />
            Stage - Saved
          </Menu.Item>
          <Menu.Item as="a">
            <Icon name="log out" />
            Log Out
          </Menu.Item>
        </Sidebar>

        <Sidebar.Pusher>
          <Segment basic>
            <Landing />
            <Button onClick={() => setVisibility(!visible)}>
              Show Sidebar
            </Button>
          </Segment>
        </Sidebar.Pusher>
      </Sidebar.Pushable>
    </React.Fragment>
  );
};
